 @JoseCarlos-dt6tv  

Mas não é o dirigente que aceita ou não. Eles vão fazer o que? Parar o campeonato? Fazer um campeonato  só com times dele. Infelizmente o poder está no eixo. Mas so a título de comparação: o time do Vitória mesmo, nunca foi campeão de nada, houveram 24 presidentes na CBF, nenhum baiano, a maioria do Rio, uns de SP, Pará, SC, etc e dentre todos esses o time baiano nunca ganhou nada. Bastou entrar Ednaldo Rodrigues, que é baiano, torcedor do Vitória e coincidentemente o time que ele torce conquista uma série B. 
Vc está entendendo o que quero dizer? Se não me engano, qnd houveram 4 representantes de SC na série A, quem estava na vice presidência ou alguma cadeira se relevância na CBF, era um presidente da Federação catarinense. Muita coincidência. Imagine qnd só tem dirigentes lá dentro do Rio e os clubes pra ir "conversar" com o presidente da CBF só basta pegar um ônibus urbano pra chegar a sede da Confederação. O Sul tem muito mais força representativa na CBF do qq qualquer time do CO, NE e Norte do país. Tbm vejo muitas facilidades por aí.

 @GuntherXP  Sobre a questão da Libertadores antes da década de 90 foi simples, os clubes Brasileiros não davam tanta importância e era extremamente violento MESMO ASSIM o Palmeiras e o São Paulo foram finalistas, o Santos ganhou duas, o Inter foi finalista na década de 70, o Grêmio e o Flamengo venceram na década de 80, o Cruzeiro venceu uma e foi finalista de outra e a pergunta que fica é... Nessa época teve algum time nordestino que sequer chegou a ser finalista na Libertadores? 

A Libertadores só começou a se tornar obsessão depois que o São Paulo do Telê ganhou em 92 e 93, aí sim os times brasileiros começaram a dar valor visto que até os campeonatos regionais (Paulistão, no caso aqui de SP) tinha mais relevância que uma Libertadores, só quem viveu nos anos 90 (Como eu) sabe muito bem disso.

Então como disse e repito a culpa do fracasso dos times do nordeste não está nos outros, no clima, na chuva como você disse, é muito fácil apontar o dedo para os outros e para as coisas e atribuir as culpas em vez de assumir, enquanto a mentalidade não mudar os times do nordeste sempre serão os times que ficam na parte de baixo da tabela brigando para não cair, a verdade é dura mas necessária.

Anotações da temporada do Santos:

Ano muito triste pela perda do rei Pelé;
Santos coloca uma coroa no escudo;
Quase foi rebaixado no estadual;
Inicia o Brasileirão REI;
Eliminação na Copa do Brasil pelo Bahia nos pênaltis;
1 semana depois é eliminado da Copa Sulamericana na fase de grupos;
Dívida de quase 400 milhões é quitada da transferência do Leandro Damião;
Reforma no estádio e reprovação da torcida;
Soteldo é afastado do elenco do Santos por Paulo Turra;
5 treinadores diferentes durante o Brasileirão;
Levou 7x1 do Inter;
Soteldo pisou na bola;
Santos fica fora da Copa do Brasil de 2024;
Santos é rebaixado em casa e levou o famoso '' gol que Pelé não fez '' do Lucero do Fortaleza.

